import React from 'react'
import styled from 'styled-components';

const Tool_Tech = () => {
  return (
    <>
      <Wrapper>
        <div className="container">
          <h1>Tools & Tech Stack</h1>
          <p>
            Get what you are looking for to fulfill your software development and outsourcing needs at Ftechiz, with our expertise on all in-demand technologies & platforms.</p>
            <div className='grid grid-five-column'>
              <div>hhh</div>
              <div className='2_column'>
              <img decoding="async"   src="https://ftechiz.com/wp-content/uploads/2022/07/4373284_angular_logo_logos_icon.svg" class="attachment-large size-large wp-image-711" alt="" loading="lazy"/>
              <img decoding="async" src="https://ftechiz.com/wp-content/uploads/2022/08/652581_code_command_develop_javascript_language_icon-1024x1024.png" class="attachment-large size-large wp-image-1257" alt="" loading="lazy" srcset="https://ftechiz.com/wp-content/uploads/2022/08/652581_code_command_develop_javascript_language_icon-1024x1024.png 1024w, https://ftechiz.com/wp-content/uploads/2022/08/652581_code_command_develop_javascript_language_icon-300x300.png 300w, https://ftechiz.com/wp-content/uploads/2022/08/652581_code_command_develop_javascript_language_icon-150x150.png 150w, https://ftechiz.com/wp-content/uploads/2022/08/652581_code_command_develop_javascript_language_icon-768x768.png 768w, https://ftechiz.com/wp-content/uploads/2022/08/652581_code_command_develop_javascript_language_icon-1536x1536.png 1536w, https://ftechiz.com/wp-content/uploads/2022/08/652581_code_command_develop_javascript_language_icon-2048x2048.png 2048w" sizes="(max-width: 1024px) 100vw, 1024px"></img>
              </div>
              <div className='3_column'>
              <img decoding="async"   src="https://ftechiz.com/wp-content/uploads/2022/07/7423888_react_react-native_icon.svg" class="attachment-large size-large wp-image-712" alt="" loading="lazy"/>
              <img decoding="async" width="1024" height="1024" src="https://ftechiz.com/wp-content/uploads/2022/08/4375066_logo_sass_icon-1024x1024.png" class="attachment-large size-large wp-image-1258" alt="" loading="lazy" srcset="https://ftechiz.com/wp-content/uploads/2022/08/4375066_logo_sass_icon-1024x1024.png 1024w, https://ftechiz.com/wp-content/uploads/2022/08/4375066_logo_sass_icon-300x300.png 300w, https://ftechiz.com/wp-content/uploads/2022/08/4375066_logo_sass_icon-150x150.png 150w, https://ftechiz.com/wp-content/uploads/2022/08/4375066_logo_sass_icon-768x768.png 768w, https://ftechiz.com/wp-content/uploads/2022/08/4375066_logo_sass_icon-1536x1536.png 1536w, https://ftechiz.com/wp-content/uploads/2022/08/4375066_logo_sass_icon-2048x2048.png 2048w" sizes="(max-width: 1024px) 100vw, 1024px"></img>
              </div>
              <div>
              <img decoding="async"   src="https://ftechiz.com/wp-content/uploads/2022/07/317755_badge_html_html5_achievement_award_icon.png" class="attachment-large size-large wp-image-710" alt="" loading="lazy"/>
              <img decoding="async" width="1024" height="1024" src="https://ftechiz.com/wp-content/uploads/2022/08/282806_jquery_logo_icon-1024x1024.png" class="attachment-large size-large wp-image-1259" alt="" loading="lazy" srcset="https://ftechiz.com/wp-content/uploads/2022/08/282806_jquery_logo_icon-1024x1024.png 1024w, https://ftechiz.com/wp-content/uploads/2022/08/282806_jquery_logo_icon-300x300.png 300w, https://ftechiz.com/wp-content/uploads/2022/08/282806_jquery_logo_icon-150x150.png 150w, https://ftechiz.com/wp-content/uploads/2022/08/282806_jquery_logo_icon-768x768.png 768w, https://ftechiz.com/wp-content/uploads/2022/08/282806_jquery_logo_icon-1536x1536.png 1536w, https://ftechiz.com/wp-content/uploads/2022/08/282806_jquery_logo_icon-2048x2048.png 2048w" sizes="(max-width: 1024px) 100vw, 1024px"></img>
              </div>
              <div>
              <img decoding="async" src="https://ftechiz.com/wp-content/uploads/2022/07/317756_badge_css_css3_achievement_award_icon.png" class="attachment-large size-large wp-image-707" alt="" loading="lazy"/>
              <img decoding="async" width="1024" height="1024" src="https://ftechiz.com/wp-content/uploads/2022/08/8546808_bootstrap_icon-1024x1024.png" class="attachment-large size-large wp-image-1260" alt="" loading="lazy" srcset="https://ftechiz.com/wp-content/uploads/2022/08/8546808_bootstrap_icon-1024x1024.png 1024w, https://ftechiz.com/wp-content/uploads/2022/08/8546808_bootstrap_icon-300x300.png 300w, https://ftechiz.com/wp-content/uploads/2022/08/8546808_bootstrap_icon-150x150.png 150w, https://ftechiz.com/wp-content/uploads/2022/08/8546808_bootstrap_icon-768x768.png 768w, https://ftechiz.com/wp-content/uploads/2022/08/8546808_bootstrap_icon-1536x1536.png 1536w, https://ftechiz.com/wp-content/uploads/2022/08/8546808_bootstrap_icon-2048x2048.png 2048w" sizes="(max-width: 1024px) 100vw, 1024px"></img>
              </div>

            </div>
        </div>
      </Wrapper>
    </>
  )
}
const Wrapper = styled.section`
padding: 5rem 0;
h1,
p{
  color:${({ theme }) => theme.colors.heading};
  text-align:center;
  margin: 0rem 16rem;
}
.grid-five-column{
  grid-template-columns:1fr .5fr .5fr .5fr .5fr; 
  img{
    width:10rem;
    height:10rem;
  }
}
`;
export default Tool_Tech;
